import Header from './Header';
import MyLogo from './MyLogo';

const layoutStyle = {
  margin: 20,
  padding: 20,
};

const Layout = props => (
  <div style={layoutStyle}>
    <MyLogo /><Header />
    {props.children}
  </div>
);

export default Layout;
